// PHPLexerInit initializes any static state used to implement PHPLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewPHPLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func PHPLexerInit() {
	staticData := &phplexerLexerStaticData
	staticData.once.Do(phplexerLexerInit)
}

// NewPHPLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewPHPLexer(input antlr.CharStream) *PHPLexer {
	PHPLexerInit()
	l := new(PHPLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &phplexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.predictionContextCache)
	l.channelNames = staticData.channelNames
	l.modeNames = staticData.modeNames
	l.RuleNames = staticData.ruleNames
	l.LiteralNames = staticData.literalNames
	l.SymbolicNames = staticData.symbolicNames
	l.GrammarFileName = "PHPLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

